from flask import Flask
from flask_restplus import Api, Resource, fields
from werkzeug.contrib.fixers import ProxyFix

app = Flask(__name__)
app.wsgi_app = ProxyFix(app.wsgi_app)
api = Api(app, 
          version='1.0', 
          title='Get Suburb Details', 
          description='A simple Suburb Details API', 
          prefix="/v1",
          contact="john@swarmee.net",
          contact_url="www.swarmee.net"
          )

ns = api.namespace('suburb', 
                   description='Suburb API operations')

suburb = api.model('suburb', 
          {'id'         : fields.Integer(readOnly=True, description='The suburb unique identifier'),
           'suburbName': fields.String (readOnly=True, description='Suburb Code'),
           'postcode': fields.String (required=True, description='The suburb name'),
           'stateName' : fields.String (required=False, description='The suburb geo lat'),
           'stateCode': fields.String (required=False, description='The suburb geo long'),           
           'stateCapital': fields.String (required=False, description='The suburb geo long'),
           'lat': fields.Float (required=False, description='The suburb geo long'),
           'long': fields.Float (required=False, description='The suburb geo long')
                        }
                 )

class suburbDAO(object):
    def __init__(self):
        self.counter = 0
        self.suburbs = []

    def get(self, id):
        for suburb in self.suburbs:
            if suburb['id'] == id:
                return suburb
        api.abort(404, "Suburb {} doesn't exist".format(id))

    def get(self, postcode):
        for suburb in self.suburbs:
            if suburb['postcode'] == postcode:
                return suburb
        api.abort(404, "Suburb {} doesn't exist".format(postcode))

    def create(self, data):
        suburb = data
        suburb['id'] = self.counter = self.counter + 1
        self.suburbs.append(suburb)
        return suburb

