@ns.route('/')
class suburbList(Resource):
    '''Shows a list of all suburbs'''

    @ns.marshal_list_with(suburb)
    def get(self):
        '''List all suburbs'''
        return DAO.suburbs

@ns.route('/<int:id>')
@ns.response(404, 'Suburb not found')
@ns.param('id', 'The suburb id')
class Suburb(Resource):
    '''Show a single suburb based on record id'''
    @ns.marshal_with(suburb)
    def get(self, id):
        '''Fetch a given resource'''
        return DAO.get(id)

@ns.route('/<string:postcode>')
@ns.response(404, 'Suburb not found')
@ns.param('postcode', 'The suburb identifier')
class Suburb(Resource):
    '''Show a single suburb based on postcode'''
    @ns.marshal_with(suburb)
    def get(self, postcode):
        '''Fetch a given resource'''
        return DAO.get(postcode)

